import React from "react";
const Card = ({ title, description }) => {
    return(
      <div className="flex-1 bg-white shadow-md p-4">
        <h2 className="text-lg font-semibold mb-2">{title}</h2>
        <p>{description}</p>
      </div>
    );
  };
const Home = () => {
  return (
    <>
    <nav className="bg-gray-800 py-4">
      <div className="container mx-auto flex justify-between items-center">
        <div className="text-white font-bold">Even <span className="text-yellow-500">D</span>ango</div>
        <ul className="flex space-x-4">
          <li><a href="/home" className="text-white  hover:text-yellow-500">Home</a></li>
          <li><a href="/home" className="text-white  hover:text-yellow-500">Creat</a></li>
          <li><a href="/home" className="text-white  hover:text-yellow-500">profile</a></li>
          <li><a href="/about" className="text-white  hover:text-yellow-500">About</a></li>
          <li><a href="#" className="text-white  hover:text-yellow-500">Contact</a></li>
        </ul>
      </div>
    </nav>
    <div className="container mx-auto mt-8">
      <h1 className="text-2xl font-bold">Welcome to My Website</h1>
      <div className="flex mt-8">
        <Card
          title="Card 1"
          description="Lorem ipsum dolor sit amet, consectetur adipiscing elit."
        />
        <Card
          title="Card 2"
          description="Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas."
        />
        <Card
          title="Card 3"
          description="Donec aliquam massa neque, quis elementum neque fermentum eu."
        />
      </div>
    </div>
    </>
  );
};

export default Home;
